import Button from "@mui/material/Button";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";

const array = ["hola", "hola2", "hola3"];

function Home() {
  return (
    <>
      {array.map((element) => {
        return <Button variant="text">{element}</Button>;
      })}

      <Grid container spacing={2}>
        <Grid backgroundColor="red" item xs={8}>
          <Paper sx={{ borderRadius: "25px" }} elevation={5}>
            <Box p={1}>
              <Typography variant="h5">custom border radius</Typography>
              {/* Include the image here */}
              <img src="../assets/BackgroundImage.png" alt="logo" />
            </Box>
          </Paper>
        </Grid>
        <Grid item xs={4}>
          xs=4
        </Grid>
        <Grid item xs={4}>
          xs=4
        </Grid>
        <Grid item xs={8}>
          xs=8
        </Grid>
      </Grid>
    </>
  );
}

export default Home;
